import './TodoSearch.css'

function TodoSearch() {
    return (
        <input 
         placeholder="Write your TODO"
         className='TodoSearch'
         onChange={(event) => {
                <TodoList>
                {defaultTodos.map(todo => (
                <TodoItem 
                    key={todo.text}
                    text={todo.text} 
                    completed={todo.completed} 
                />
                ))}
            </TodoList>
            }}
        />
    );
}

export { TodoSearch };
